import {SETPATIENTDATA} from './patientData.types';


const INITIAL_STATE = {

    patientName:null,
    patientPickupAddress:null,
    patientPickUpTime: null,
    patientNotes:null,
};

const reducer = (state = INITIAL_STATE, action) => {

    switch (action.type) {

        case INCREMENT:

           return {

             ...state, count: state.count + 1,

           };

         default: return state;

    }

};

export default reducer;
